import "./CardOompaDetails.css"

const CardOompaDetail = (props) => {
    const {data} = props
    console.log(data)
    return(
        <div className="container-oompa-details">
            <div>
                <img src={data.image}/>
            </div>
            <div>
                <h4>{`${data.first_name} ${data.last_name}`}</h4>
                {data.gender === "M" ? <p>Male</p> : <p>Female</p>}
                <p>{data.profession}</p>
            </div>
        </div>

    )
}

export default CardOompaDetail;
